  const { register, handleSubmit } = useForm();
  const [submitForm, { loading }] = useMutation(SUBMIT_FORM_MUTATION);

  const onSubmit = async (data) => {
    try {
      const result = await submitForm({ variables: { input: data } });
      console.log(result);
      history.push('/success'); // Redirect to success page
