      console.error(error);
    }
  };

  return (
    <form onSubmit={handleSubmit(onSubmit)}>
      <input type="text" {...register('name')} placeholder="Name" />
      <input type="email" {...register('email')} placeholder="Email" />
      {/* Add other form fields as needed */}
      <button type="submit" disabled={loading}>
        Submit
