Here's a JavaScript implementation for packing and unpacking an array of entities into an ArrayBuffer. The entities have the fields `id` (4 bits) and `size` (3 bits).

```javascript
function packEntities(entities) {
  const buffer = new ArrayBuffer(entities.length);
  const view = new DataView(buffer);

  for (let i = 0; i < entities.length; i++) {
    const entity = entities[i];

    // Pack id (4 bits)
    view.setUint8(i * 2, entity.id >> 4);
    view.setUint8(i * 2 + 1, entity.id & 0xF);

    // Pack size (3 bits)
    view.setUint8(i * 2 + 2, entity.size >> 5);
    view.setUint8(i * 2 + 3, (entity.size & 0x1F) << 3);
  }

  return buffer;
}

function unpackEntities(buffer, offset = 0) {
  const entities = [];
  const view = new DataView(buffer);

  for (let i = offset; i < buffer.byteLength; i += 4) {
    const id = (view.getUint8(i) << 4) | view.getUint8(i + 1);
    const size = (view.getUint8(i + 2) >> 3) | (view.getUint8(i + 3) << 5);

    entities.push({ id, size });
  }

  return entities;
}
```

In the `packEntities` function, we create an ArrayBuffer with the specified size and a DataView to manipulate the buffer. We iterate through the entities and pack their id and size into the buffer.

In the `unpackEntities` function, we create an ArrayBuffer, a DataView, and an empty array to store the unpacked entities. We iterate through the buffer in steps of 4 bytes (since each entity requires 4 bytes to store its id and size). We unpack the id and size from the buffer and push the entity into the array.

You can use these functions like this:

